import React, { Component } from 'react';
import { Image } from 'react-native';
import { Container, H1, View, DeckSwiper, Card, CardItem, Thumbnail, Text, Left,Right, Body, Icon } from 'native-base';


const cards = [
  {
    place: 'Oaxaca,Oaxaca',
    stars: '4.5',
    image: require('./img/image1.jpg'),
    text: 'lorem ipsum Lorem, ipsum dolor sit amet consectetur adipisicing elite '
  },

];
export default class SwipCards extends Component {
  render() {
    return (
      <Container>

        <View>
          <DeckSwiper
            dataSource={cards}
            renderItem={item =>
              <Card style={{ elevation: 3, border:'solid',  borderRadius:'10px', padding:'20px', color: '#4D5E73' }}>
                        <H1  style = {{padding:'10px'}}>Header One</H1>

                 <CardItem cardBody>

          <Thumbnail
            source={item.image}
            style={{ height: 200, width: null, flex: 1, borderRadius:'10px', padding:'20px', }}
          />
        </CardItem>
        <CardItem style = {{

width:'304px',
height: 'auto',
left:' 0px',
top:'15px',
backgroundColor: 'gray'
}}>
        <Body>
            <Text >
              {item.text}
            </Text>
          </Body>
          <Left>
            <Icon  style= {{color: '#4D5E73'}} active name="navigate" />
            <Text >{item.place}</Text>
            </Left>


       <Right>
            <Icon  style= {{color: '#25EAA8'}} active name="star" />
            <Text>
              {item.stars}
            </Text>
            </Right>

        </CardItem>
        <View style = {{
          width:'304px',
          height: 'auto',
          position:'relative',
          left:'24px',
          top:'15px',

        }}>

        </View >
      <CardItem style={{ 
          flexDirection: 'row',
        justifyContent: 'space-between',
         }}>

          </CardItem >

      </Card>

            }
          />
        </View>

      </Container>
    );
  }
}
